function evalLayout(layout, data, perFinger, perKey) {
	var perFinger = document.getElementById('chartChoice:perFinger').checked
	var perKey = document.getElementById('chartChoice:perKey').checked
	var blue = "data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABCAYAAAAfFcSJAAAADUlEQVR42mNkaPj/HwAEhwKAGqTFYAAAAABJRU5ErkJggg=="

	var textLength = 0
	var strokeLength = 0
	var lCount = 0
	var rCount = 0
	var fl4Count = 0
	var fl3Count = 0
	var fl2Count = 0
	var fl1Count = 0
	var fr1Count = 0
	var fr2Count = 0
	var fr3Count = 0
	var fr4Count = 0
	var rl4Count = 0
	var rl3Count = 0
	var rl2Count = 0
	var rl1Count = 0
	var rr4Count = 0
	var rr3Count = 0
	var rr2Count = 0
	var rr1Count = 0
	var keyCount = {}

	for (var text in data) {
		var count = data[text]
		var strokes = text
		layout[2].forEach(function(element) {
			strokes = strokes.replace(new RegExp(element[0], 'g'), element[1])
		})
		strokes = strokes.replace(/:R/g, 'X')
		strokes = strokes.replace(/\|L/g, 'X')
		strokes = strokes.replace(/\|S/g, 'X')
		strokes = strokes.replace(/[:\|X]/g, '')
		strokeLength += strokes.length * count
		textLength += text.length * count

		if (perFinger) {
			// left/right
			var lr = strokes.replace(/[SLR]/g, '')
			lr = lr.replace(/[12345qwertasdfgzxcvb\[\]]/g, 'L')
			lr = lr.replace(/[67890yuiop\-=hjkl;''\\nm,\.\/]/g, 'R')
			if (m = lr.match(/L/g)) lCount += m.length * count
			if (m = lr.match(/R/g)) rCount += m.length * count

			// column frequency
			var cf = strokes.replace(/[SLR]/g, '')
			cf = cf.replace(/[qaz\[\]]/g, 'A')
			cf = cf.replace(/[12wsx]/g, 'B')
			cf = cf.replace(/[3edc]/g, 'C')
			cf = cf.replace(/[45rfvtgb]/g, 'D')
			cf = cf.replace(/[67yhnujm]/g, 'E')
			cf = cf.replace(/[8ik,]/g, 'F')
			cf = cf.replace(/[90ol\.]/g, 'G')
			cf = cf.replace(/[p;\/\-''=\\]/g, 'H')
			if (m = cf.match(/A/g)) fl4Count += m.length * count
			if (m = cf.match(/B/g)) fl3Count += m.length * count
			if (m = cf.match(/C/g)) fl2Count += m.length * count
			if (m = cf.match(/D/g)) fl1Count += m.length * count
			if (m = cf.match(/E/g)) fr1Count += m.length * count
			if (m = cf.match(/F/g)) fr2Count += m.length * count
			if (m = cf.match(/G/g)) fr3Count += m.length * count
			if (m = cf.match(/H/g)) fr4Count += m.length * count

			// row frequency
			var rf = strokes.replace(/[SLR]/g, '')
			rf = rf.replace(/[12345]/g, 'A')
			rf = rf.replace(/[\[\]qwert]/g, 'B')
			rf = rf.replace(/[asdfg]/g, 'C')
			rf = rf.replace(/[zxcvb]/g, 'D')
			rf = rf.replace(/[67890]/g, 'E')
			rf = rf.replace(/[yuiop\-=]/g, 'F')
			rf = rf.replace(/[hjkl;''\\]/g, 'G')
			rf = rf.replace(/[nm,\.\/]/g, 'H')
			if (m = rf.match(/A/g)) rl4Count += m.length * count
			if (m = rf.match(/B/g)) rl3Count += m.length * count
			if (m = rf.match(/C/g)) rl2Count += m.length * count
			if (m = rf.match(/D/g)) rl1Count += m.length * count
			if (m = rf.match(/E/g)) rr4Count += m.length * count
			if (m = rf.match(/F/g)) rr3Count += m.length * count
			if (m = rf.match(/G/g)) rr2Count += m.length * count
			if (m = rf.match(/H/g)) rr1Count += m.length * count
		}
		if (perKey) {
			// key frequency
			var kf = strokes.replace(/[SLR]/g, '')
			for (i = 0; i < strokes.length; i++) {
				var k = strokes.slice(i, i+1)
				if (!keyCount[k]) keyCount[k] = 0
				keyCount[k] += count
			}
		}
	}

	var barWidth = 12

		cfChart += '<td rowspan="4"><img src="' + blue + '" width="' + barWidth + '" height="' + (Math.round(barScale * fl1Count / strokeLength)) + '"></td>'
		cfChart += '<td rowspan="4"><img src="' + blue + '" width="' + barWidth + '" height="' + (Math.round(barScale * fr1Count / strokeLength)) + '"></td>'
		cfChart += '<td rowspan="4"><img src="' + blue + '" width="' + barWidth + '" height="' + (Math.round(barScale * fr2Count / strokeLength)) + '"></td>'
		cfChart += '<td rowspan="4"><img src="' + blue + '" width="' + barWidth + '" height="' + (Math.round(barScale * fr3Count / strokeLength)) + '"></td>'
		cfChart += '<td rowspan="4"><img src="' + blue + '" width="' + barWidth + '" height="' + (Math.round(barScale * fr4Count / strokeLength)) + '"></td>'
		var rfChart = ''
		rfChart += '<td style="text-align: right"><img src="' + green + '" height="' + barWidth + '" width="' + (Math.round(barScale * rl4Count / strokeLength)) + '"></td>'
		// rfChart += '<td class="percentage">' + (rl4Count / strokeLength * 100).toFixed(0) + '%</td>'
		rfChart += cfChart
		// rfChart += '<td class="percentage">' + (rr4Count / strokeLength * 100).toFixed(0) + '%</td>'
		rfChart += '<td style="text-align: left"><img src="' + green + '" height="' + barWidth + '" width="' + (Math.round(barScale * rr4Count / strokeLength)) + '"></td>'
		rfChart += '</tr><tr>'
		rfChart += '<td style="text-align: right"><img src="' + green + '" height="' + barWidth + '" width="' + (Math.round(barScale * rl3Count / strokeLength)) + '"></td>'
		// rfChart += '<td class="percentage">' + (rl3Count / strokeLength * 100).toFixed(0) + '%</td>'
		// rfChart += '<td class="percentage">' + (rr3Count / strokeLength * 100).toFixed(0) + '%</td>'
		rfChart += '<td style="text-align: left"><img src="' + green + '" height="' + barWidth + '" width="' + (Math.round(barScale * rr3Count / strokeLength)) + '"></td>'
		rfChart += '</tr><tr>'
		rfChart += '<td style="text-align: right"><img src="' + green + '" height="' + barWidth + '" width="' + (Math.round(barScale * rl2Count / strokeLength)) + '"></td>'
		// rfChart += '<td class="percentage">' + (rl2Count / strokeLength * 100).toFixed(0) + '%</td>'
		// rfChart += '<td class="percentage">' + (rr2Count / strokeLength * 100).toFixed(0) + '%</td>'
		rfChart += '<td style="text-align: left"><img src="' + green + '" height="' + barWidth + '" width="' + (Math.round(barScale * rr2Count / strokeLength)) + '"></td>'
		rfChart += '</tr><tr>'
		rfChart += '<td style="text-align: right"><img src="' + green + '" height="' + barWidth + '" width="' + (Math.round(barScale * rl1Count / strokeLength)) + '"></td>'
		// rfChart += '<td class="percentage">' + (rl1Count / strokeLength * 100).toFixed(0) + '%</td>'
		// rfChart += '<td class="percentage">' + (rr1Count / strokeLength * 100).toFixed(0) + '%</td>'
		rfChart += '<td style="text-align: left"><img src="' + green + '" height="' + barWidth + '" width="' + (Math.round(barScale * rr1Count / strokeLength)) + '"></td>'
		rfChart = '<tr>' + rfChart + '</tr>'
		var lrTable = ''
		lrTable += '<td class="percentage"></td>'
		// lrTable += '<td class="percentage"></td>'
		lrTable += '<td class="percentage" colspan="4">' + (lCount / strokeLength * 100).toFixed(0) + '%</td>'
		lrTable += '<td class="percentage" colspan="4">' + (rCount / strokeLength * 100).toFixed(0) + '%</td>'
		// lrTable += '<td class="percentage"></td>'
		lrTable += '<td class="percentage"></td>'
		lrTable = '<tr>' + lrTable + '</tr>'
		inner += '<table class="nested">' + rfChart + lrTable + '</table>'
	}
	if (perKey) {
		var kfTable = ''
		var keyCountMax = 0
		for (var i = 0; i < physical_layout.length; i++) {
			for (j = 0; j < physical_layout[i].length; j++) {
				k = physical_layout[i].slice(j, j+1)
				if (keyCount[k]) {
					if (keyCountMax < keyCount[k]) {
						keyCountMax = keyCount[k]
					}
				}
			}
		}
		for (var i = 0; i < physical_layout.length; i++) {
			kfTable += '<tr>'
			for (j = 0; j < physical_layout[i].length; j++) {
				k = physical_layout[i].slice(j, j+1)
				if (!keyCount[k]) {
					kfTable += '<td class="percentage">&nbsp;</td>'
				} else {

			}
			kfTable += '</tr>'

		inner += '<table class="nested keymap">' + kfTable + '</table>'
	}
	return '<td>' + inner + '</td>'

		var data = {}
		var checkboxes = document.getElementsByName('corpusChoice' + c)
		corpuses.forEach(function(corpus, index) {
			var checkbox = document.getElementById('corpusChoice' + c + ':' + corpus[1])
			if (checkbox.checked) {
				console.log('Loading corpus "' + corpus[1] + '" into column ' + c)
				var count = 0
				corpus[2].forEach(function(element) {
					var freq = element[0]
					var text = element[1]
					text = text.replace(/[ァ-ヶ]/g, function(s) {
						return String.fromCharCode(s.charCodeAt(0) - 0x60); // カタカナ→ひらがな
					})
					if (!data[text]) data[text] = 0
					data[text] += freq
					count += freq
				})
				// 約物の数を推定して追加
				punctuations.forEach(function(element) {
					var freq = element[0]
					var text = element[1]
					freq = Math.round(freq * count)
					if (!data[text]) data[text] = 0
					data[text] += freq
				})
			}
		})
		datas[c] = data
	}
}

function evalLayouts() {
	var table = document.getElementById('result')
	var tbody = document.createElement('tbody')
	layouts.forEach(function(layout) {
		var row = document.createElement('tr')
		var cell = document.createElement('td')
		cell.textContent = layout[0]
		row.appendChild(cell)
		for (var c = 0; c < ncols; c++) {
			console.log('Evaluating layout "' + layout[0] + '"')
			var cell = document.createElement('td')
			cell.innerHTML = evalLayout(layout, datas[c])
			row.appendChild(cell)
		}
		tbody.appendChild(row)
	})
	table.appendChild(tbody)
}

function update() {
	resetTable()
	loadCorpuses()
	evalLayouts()
}

initTable()
loadCorpuses()
evalLayouts()
</script>
</body>
</html>
